import React from 'react'
import Jumbotron from './components/jumbotron'
import jumboData from './fixtures/jumbo.json'
export default function App() {
  return (
    <Jumbotron.Container>
      {jumboData.map((item) => (
        <Jumbotron key={item.id} />
      ))}
    </Jumbotron.Container>
  )
}
